sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...

var str = inputs.body;
//var str = '{"Impact":"11804.347601293037","user_id":"system","NewPrice":"80.45100000000001","Frequency":"6641.016843972381","Material":"Base E27","OldPrice":"89.39"}';

var obj = JSON.parse(str);

outputs.proc = obj.Process;
outputs.ineff = obj.Inefficiency;
outputs.desc = obj.Description;
outputs.buis_obj = obj.BusinessObjective;
outputs.type = obj.Type;
outputs.buis_imp = obj.BusinessImpact;
outputs.buis_doc = obj.BusinessDocument;
outputs.aff_doc = obj.AffectedDocuments;
outputs.user_id = obj.user_id;

})(inputs, outputs);

